import React, { useState } from "react";

const Navbar = () => {
  const [open, setOpen] = useState(false);

  return (
    <nav className="fixed w-full bg-white dark:bg-gray-800 shadow-md z-50">
      <div className="max-w-6xl mx-auto px-4 flex justify-between items-center h-16">
        <div className="text-2xl font-bold">Angel</div>
        <div className="hidden md:flex space-x-6">
          <a href="#home">Home</a>
          <a href="#about">About</a>
          <a href="#skills">Skills</a>
          <a href="#projects">Projects</a>
          <a href="#contact">Contact</a>
        </div>
        <div className="md:hidden" onClick={() => setOpen(!open)}>
          <button className="text-xl">{open ? "✖" : "☰"}</button>
        </div>
      </div>
      {open && (
        <div className="md:hidden flex flex-col bg-white dark:bg-gray-800">
          <a href="#home" className="p-4">Home</a>
          <a href="#about" className="p-4">About</a>
          <a href="#skills" className="p-4">Skills</a>
          <a href="#projects" className="p-4">Projects</a>
          <a href="#contact" className="p-4">Contact</a>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
